Accounts_CustomFields_Description:
Θα πρέπει να είναι έγκυρη JSON όπου κλειδιά είναι τα ονόματα των πεδίων που περιέχουν ένα λεξικό από πεδία ρυθμίσεων. Παράδειγμα: <br/><code>{
 "role": {
  "type": "select",
  "defaultValue": "student",
  "options": ["teacher", "student"],
  "required": true,
  "modifyRecordField": {
   "array": true,
   "field": "roles"
  }
 },
 "twitter": {
  "type": "text",
  "required": true,
  "minLength": 2,
  "maxLength": 10
 }
}</code>

Custom_Translations_Description:
Θα πρέπει να είναι μια έγκυρη JSON όπου κλειδιά είναι οι γλώσσες που θα περιέχουν ένα λεξικό κλειδιών και μεταφράσεων. Παράδειγμα: <br/><code>{
 "en": {
  "Channels": "Rooms"
 },
 "pt": {
  "Channels": "Salas"
 }
}</code>
